import React from 'react';
import { Redirect } from 'react-router-dom';

const Logout = ()=>{
    localStorage.removeItem('isLogin');

    return(
        <>
            <Redirect to="/login" />
            <h1>Logout</h1>
        </>
    )
};

export default Logout;
